function maxValue(e,t){t++;var n=hasWinner(e);if(n!=null)return n==IA_PLAYER?Number.POSITIVE_INFINITY:Number.NEGATIVE_INFINITY;if(t>MAX_ITERATION)return utility(e,IA_PLAYER);var r=Number.NEGATIVE_INFINITY,i=getPossibleMovements(e,IA_PLAYER);for(var s=0;s<i.length;s++)r=Math.max(r,minValue(i[s].table,t));return r}function minValue(e,t){t++;var n=hasWinner(e);if(n!=null)return n==IA_PLAYER?Number.POSITIVE_INFINITY:Number.NEGATIVE_INFINITY;if(t>MAX_ITERATION)return utility(e,HUMAN_PLAYER);var r=Number.POSITIVE_INFINITY,i=getPossibleMovements(e,HUMAN_PLAYER);for(var s=0;s<i.length;s++)r=Math.min(r,maxValue(i[s].table,t));return r}function minimaxDecision(e){var t=getPossibleMovements(e,IA_PLAYER),n=Number.NEGATIVE_INFINITY,r=null;for(var i=0;i<t.length;i++){var s=minValue(t[i].table,0);if(s>n){n=s;r=i}}return t[r]}function utility(e,t){var n=0,r=0;for(var i=0;i<e.length;i++)for(var s=0;s<e[0].length;s++)e[i][s]!=EMPTY_CELL&&e[i][s]!=t?n++:e[i][s]==t&&r++;return-n};